function waitForElement(elementId, callBack){
  window.setTimeout(function(){
    var element = document.getElementById(elementId);
    if(element){
      callBack(elementId, element);
    }else{
      waitForElement(elementId, callBack);
    }
  },100)
}

waitForElement("onedrive-calendars",function(){
    document.getElementById("onedrive-calendars").style.display = 'none';
});
waitForElement("toggle-onedrive-navigation-link",function(){
    document.getElementById("toggle-onedrive-navigation-link").style.display = 'none';
});
waitForElement("google-contacts",function(){
    document.getElementById("google-contacts").style.display = 'none';
});
waitForElement("google-calendars",function(){
    document.getElementById("google-calendars").style.display = 'none';
});
